--
-- Table structure for table `user_transfer`
--

DROP TABLE IF EXISTS `user_transfer`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `user_transfer` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) unsigned NOT NULL COMMENT '用户id',
  `trans_date` datetime NOT NULL COMMENT '转账日期',
  `trans_no` varchar(30) NOT NULL COMMENT '自平台转账流水号',
  `plat_trans_no` varchar(30) NOT NULL DEFAULT '' COMMENT '第三方平台转账流水号',
  `trans_io` tinyint(1) NOT NULL COMMENT '转账io -1:转出 1:转入',
  `platform` varchar(10) NOT NULL COMMENT '对方平台id',
  `amount` decimal(10,2) NOT NULL COMMENT '转账金额',
  `before_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '转账前金额',
  `after_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '转账后金额',
  `description` varchar(40) NOT NULL DEFAULT '' COMMENT '描述',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '转账状态 0:初始状态 1:第三方平台转账成功 2:系统充值成功(转账成功) 3:冻结转账 4:转账出错',
  `error_msg` varchar(255) NOT NULL DEFAULT '' COMMENT '错误消息',
  `update_admin_id` int(11) NOT NULL DEFAULT '0' COMMENT '更新者id',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  `create_admin_id` int(11) NOT NULL DEFAULT '0' COMMENT '创建者id',
  `create_time` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`),
  KEY `idx_user_id` (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=87056 DEFAULT CHARSET=utf8 COMMENT='用户钱包转账记录表';
/*!40101 SET character_set_client = @saved_cs_client */;

--
-- Dumping data for table `user_transfer`
--

LOCK TABLES `user_transfer` WRITE;
/*!40000 ALTER TABLE `user_transfer` DISABLE KEYS */;
